    fetch(`https://pokeapi.co/api/v2/pokemon/${pokemonName}`)
      .then((response) =>
    //    response.json(),
       console.log('response', response.json()))
      .then((data) => {
        data.results &&
          setItems(data.results.map((result) => <div>{result.name}</div>));
      });
  }, []);

